import {Box, TextField} from "@material-ui/core"



export const Main = () => {
    return(
        <Box component="form">
            <TextField
          id="outlined-number"
          label="Number"
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
        />
        </Box>
    )
}
